        margin-top: 19px;
        display: flex;
        justify-content: space-between;
        .dropdown_button{
            border: none;
            background: white;
            font-family: 'Montserrat';
            font-weight: bold;
            font-size: 12px;
            color: #BC9CFF;
            padding: 0;
            cursor: pointer;
            &:focus{
                outline: none;
            }
